import React, { useState } from 'react';

const Gasto = ({gasto}) => (
    <li className="gastos">
        <p>
            {gasto.nombre}

            <span className="gasto">$ {gasto.cantidad}</span>
        </p>
    </li>
);

export default Gasto;
